DROP TABLE public.lobbyist_agency_action;

CREATE TABLE public.lobbyist_agency_action  ( 
  id                  serial not null,
	last_name         	varchar(150) NULL,
	first_name        	varchar(150) NULL,
	agency_code       	varchar(150) NULL,
	admin_action      	boolean NULL,
	legislative_action	boolean NULL,
	action_sought     	varchar(100) NULL,
	firm_name           varchar(150) NULL,

  CONSTRAINT lobbyist_agency_action_pk PRIMARY KEY(id)
);

